const state = {
  forms: [
    {
      id: 0,
      name: "Formulario",
      description: "",
      image:
        "data:image/jpeg;base64,",
    },
    {
      id: 1,
      name: "Formulario",
      description: "",
      image:
        "data:image/jpeg;base64,",
    },
    {
      id: 2,
      name: "Formulario",
      description: "",
      image:
        "data:image/jpeg;base64,",
    },
    {
      id: 3,
      name: "Formulario",
      description: "",
      image:
        "data:image/jpeg;base64,",
    },
  ],
  selectedForm: undefined,
  user: localStorage.getItem("user"),
  questions: [],
  selectedQuestion: undefined,
  page: {
    id: 0,
    name: "active",
  },
};

export default {
  init,
  onSignOut,
  onSelectedForm,
  onDeleteForm,
  onAddedQuestion,
  onSelectedQuestion,
  onDeleteQuestion,
  onUpdateQuestion,
  onChangePage,
};

function init() {
  return Promise.resolve(Object.assign(state));
}

function onSignOut() {
  localStorage.clear();
}

function onSelectedForm(input) {
  return Promise.resolve(
    Object.assign({}, input.state, { selectedForm: input.form })
  );
}

function onDeleteForm(input) {
  input.state.forms = input.state.forms.filter((item) => item.id !== input.id);
  return Promise.resolve(Object.assign({}, input.state));
}

function onAddedQuestion(input) {
  input.state.questions.push(input.question);
  onSelectedQuestion({ state: input.state, question: input.question });
  return Promise.resolve(Object.assign({}, input.state));
}

function onUpdateQuestion(input) {
  const index = input.state.questions.findIndex(
    (item) => item.id === input.state.selectedQuestion.id
  );
  input.state.questions[index].question = input.question?.question;
  input.state.questions[index].type = input.type?.type;
  input.state.selectedQuestion = input.state.questions[index];
  return Promise.resolve(Object.assign({}, input.state));
}

function onSelectedQuestion(input) {
  input.state.selectedQuestion = input.question;
  return Promise.resolve(Object.assign({}, input.state));
}

function onDeleteQuestion(input) {
  input.state.questions = input.state.questions.filter(
    (item) => item.id !== input.id
  );
  return Promise.resolve(Object.assign({}, input.state));
}

function onChangePage(input) {
  return Promise.resolve(
    Object.assign({}, input.state, {
      page: {
        id: input.page.id,
        name: input.page.name,
      },
    })
  );
}
